import React from 'react';
import './Hero.css';
import heroImage from '../assets/hero-image.jpg'; // replace with your image path

const Hero = () => {
  return (
    <section className="hero">
      <div className="container">
        <div className="content">
          <h1>Welcome to My Portfolio</h1>
          <p>Building beautiful, performant web experiences with React JS and modern web technologies.</p>
          <a href="#contact" className="cta">Get In Touch</a>
        </div>
        <div className="image">
          <img src={heroImage} alt="Hero" className="logo" />
        </div>
      </div>
    </section>
  );
};

export default Hero;
